import React from "react";

const ToDoList = (props) =>{
    return (
        <>
            <li><button 
            className="cancelBtn" 
            onClick={()=>{
                props.onSelect(props.id);
            }}
            > + </button> {props.text}</li>
        </>
    );
}
export default ToDoList;
